import React from 'react'
import data from '../../data/data'

function Fixture() {

    console.log(data.groupA.matches.firstPhase)

  return (
    <div>
        {
           data.map.groupA.matches.fistPhase( match => <div id={match.id}><p>{match.local} vs. {match.visitor}</p></div>)
        }

    </div>
  )
}

export default Fixture
